import React from 'react';
import Items from './Items';

const PackingList = () => {
  return (
    <div>
      <section>
        <h1>Sang Ride's Packing List</h1>
        <ol className='list-decimal'>
          <Items isPacked={true} name="do an" />
          <Items isPacked={false} name="do uong" />
          <Items isPacked={false} name="do choi" />
        </ol>
      </section>
    </div>
  );
}

export default PackingList;
